                var html_8fe5bb925268dddb7db413576e04a0c5 = $(`<div id="html_8fe5bb925268dddb7db413576e04a0c5" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Jack Gray</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Cafe</p>                 <p style="margin:0;"><b>Rating:</b> 4.5 (285.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.19</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 59.62586167233843%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"Jack Gray is tucked away in a residential area of the Sutherland Shire, that is characterised by large houses in a beautiful lush bush setting.  First impressions suggested a laid back atmosphere with sophisticated decor in muted tones.  We joined a long share table on the pavement outside. Ordering at the counter was trouble free and efficient.  We opted for Jack‚Äôs Gourmet Deli Style Bacon and Egg roll ($16), Spring Corn and Zucchini Fritters with Smoked Salmon ($26), an orange juice ($8) and a regular flat white coffee ($5).  The juice was as expected. The coffee was good ie, temperature hot, grounds not burnt or bitter, just the right amount of milk and rich caramel undertones.  The bacon and egg roll was acceptable. The eggs were creamy in texture, though I would have preferred more seasoning. I don‚Äôt recall cheese being a major part of the flavour combination, though I could see some gratings on the plate. The relish was sweet and tangy. If you like your bacon to be crispy I‚Äôd suggest asking for this up front.  The corn fritters were crisp on the outside, and the poached egg cooked to perfection with a gooey yolk. I think the fritters were spiced with cumin. This was an interesting pairing with delicate smoked salmon. If we were to order the dish again we would have opted for bacon, or no additions.  Overall a pleasant experience."</div>             </div>             </div>`)[0];

ar that this caf√© takes pride in what they serve, and it shows in every detail.  Can‚Äôt wait to come back and try more of the menu. Highly recommend if you‚Äôre after great food, friendly service, and a spot that feels like a local favorite."</div>             </div>             </div>`)[0];

                var html_4484b01714ef04b9195154e46e5d47ad = $(`<div id="html_4484b01714ef04b9195154e46e5d47ad" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Big Red Cafe</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Cafe</p>                 <p style="margin:0;"><b>Rating:</b> 4.8 (381.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.46</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 73.16410973950303%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"A really good caf√© on the edge of Engadine centre.  Big Red has your standard Australian brunch food, all of which seems to be done to a good standard, but nothing that will blow your socks off. That said, the price definitely will, it's VERY cheap compared to most of Sutherland Shire!  Coffees were okay, but very milky for flat whites. A few sips in and you could barely taste the coffee. Takeout coffees in the past have been good though so this might have been a one off.  Service was friendly, but a little inattentive. We were there for an hour and nobody ever came out to tidy away what previous customers had left on the table.  There was a good amount of space outside thanks to the Cafe next door being closed when we visited (on a Saturday), and Big Red using some of their outdoor space. But this spot is always busy so I wouldn't count on always getting a table easily.  Highchairs were available, and there were good kids options. However, they brought the kids food out way later than the adults, which caused some predictable issues. I'd really recommend reversing that order.  Parking is available right outside on the street for an hour, and on/in various nearby streets and car parks for longer.  Overall a good spot, and somewhere we'll definitely be back to."</div>             </div>             </div>`)[0];

                var html_fa78b2be2ad5ed1a88d199bc9e107bb8 = $(`<div id="html_fa78b2be2ad5ed1a88d199bc9e107bb8" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Sublime Point Cafe & Function Centre</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Cafe</p>                 <p style="margin:0;"><b>Rating:</b> 4.2 (470.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.38</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 68.8187273960217%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"Overview We had our wedding reception and Sublime Point Cafe in January 2020 and it was absolutely wonderful. The staff were really friendly and made sure we had everything we needed, the food was great and we felt really well looked after. It is a family run business and you really get that authentic down to Earth feel. They make you really feel like it‚Äôs a special day, unlike a wedding factory venue where you are just the next customer. Apart from the obvious amazing views and scenery, the big thing for us was being treated like humans with our own thoughts and interests rather than just another customer.  Staff: Alex who runs the place is really accommodating and really easy to get along with. We had some guest with some rather hard dietary requirements and he did an exemplary job at catering for our needs! Unfortunately I can‚Äôt remember the names of everyone but the young lady who also helped us plan out the fine details was lovely to work with. And there was a guy who managed the day and just did an absolutely amazing job. We told them prior to the day our concerns that we wanted to actually eat on our wedding day, etc and he made sure that it happened. He was really reliable, friendly and made sure we had everything whether it was some space to catch our breathe, a cup of tea, you name it he was on it. And on a whole the staff were really lovely to us and our guests!  Food: Honestly it was just amazing! We HIGHLY recommend the slow cooked beef brisket and the salmon! I mean everything that Alex cooks is incredible, for example my husband hates salmon and this is the only place where he actually enjoyed eating the salmon. Even our guests with dietary requirements loved their meals!! I mean seriously the food is second to none, you get amazing quality and a lot of it (especially if you go the buffet route which again really worth doing)!  Venue: There are lots of windows to show off the amazing view and I really mean amazing view! There is air conditioning if the temperature requires it (I assume it would also heat if needed). The fairy lights really are a must in our opinion (both inside and outside). We went for a really relaxed and minimalist theme for our reception but they really can cater to whatever you want. They have many accessories like a dance floor and outside games, they also have contacts for other accessories like photo booths and DJs, etc. Honestly if you could come up with something they don‚Äôt already have I have Alex is really accommodating so he would really try to make sure you could have it at the place. The seats are really comfortable and it can adapt to different themes really well (we saw a lovely rustic theme that they did for a wedding when checking out the venue for the first time). They even do ceremonies as well (although we had ours at a church). It sat about 106 people pretty comfortably and it by no means felt squished! There were talks about doing the speeches outside but due to the bushfire smoke we opted to go indoors (although it turned out to be a really lovely day with some light rain and no smoke).  Honestly we can‚Äôt speak highly enough of the lookout and the cafe. You really have to check it out especially for all you Sydney people who never drive down south! We shocked our guests with it and every single one of them agreed that it was worth the drive!"</div>             </div>             </div>`)[0];

                var html_069db9634dba3cde9c2be0323b3db33a = $(`<div id="html_069db9634dba3cde9c2be0323b3db33a" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">UOW UniBar</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Bar</p>                 <p style="margin:0;"><b>Rating:</b> 4.3 (557.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #6c757d; font-weight:bold;">0.05</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 52.48426046176046%; background: #6c757d; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"To call this place a bar is pretty insulting to every other bar in the illawarra that are putting in even half of an effort unless the W stands for "Work Experience"  Attended an event on a Friday evening scheduled to start at 7, figured we would get there a bit earlier to grab a drink and a bite to eat beforehand because you know it's supposedly a bar. Wrong! approached the bar where we were then shooed out like children by a security guard saying they didn't open till 7. Que waiting around outside in the cold for half an hour before being let in. Just FYI with the amount of people you had waiting out in the cold in that half an hour alone you probably lost close to a grand in revenue.  As predicted bar staff could then not keep up with the sold out audience being ready to order drinks and food en masse resulting in wait times that made you miss rounds of the event, when I finally got my chance to order I asked for one of the pale ales listed on the menu, sorry we don't do that any more (taps are way down the other end of the bar out of view) so I say ok no problems any pale ale you have on tap is fine. I was told by the bar worker "I don't know what pale ale is. I don't know beer". Kitchen ran out of all but 1 or 2 menu items halfway through the event with the bar also running out of drinks and kegs.  Look I could go on but what's the point, to sum it all up.  Inept bar staff Over priced under portioned food Condescending and petulant security  Basically I have been to venues run by people living with disabilities and have had better run experiences. You get one star because 0 isn't an option. Do better because you honestly can't do any worse"</div>             </div>             </div>`)[0];

                var html_1109ef1d44fca72a1f95573b3b29f40b = $(`<div id="html_1109ef1d44fca72a1f95573b3b29f40b" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Georgia Rose</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Bar</p>                 <p style="margin:0;"><b>Rating:</b> 3.8 (619.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.37</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 68.69697712418301%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"First time to Shell Cove, which has major potential for a 'boardwalk' style dining experience in Shellharbour. Local friends took us to dinner at Georgia Rose, which has top positioning on the marina. It has a stylish pub atmosphere and although it was very busy, we managed to find a bar table.  The good: The food was really well-cooked, generous portions, and reasonably priced. The venue itself is open and light-filled with beautiful styling, and it sits right on the water ‚Äì great for people-watching or sunset drinks.  The standout: The location ‚Äì absolutely prime spot on the marina. Loved the mural on the wall and the overall aesthetic. It feels like the kind of place that could become a local favourite if they iron out a few things.  The not-so-good: It‚Äôs order-at-the-bar style, which can get confusing when it‚Äôs busy. Our group of five didn‚Äôt receive meals at the same time, and drinks came out after the food ‚Äì some confusion between bar staff. It felt a bit chaotic, though service was friendly.  Would I return? Yes ‚Äì I‚Äôd definitely give it another go when I‚Äôm down that way again. I think with time and consistency, it could be a really fantastic venue.  The verdict: Great concept in a brilliant location with lots of potential. A few hiccups with service on the night, but still worth a visit if you‚Äôre in the area ‚Äì especially on a sunny day by the water."</div>             </div>             </div>`)[0];

                var html_9b96e36786844eb2bcacb3bd6b099d78 = $(`<div id="html_9b96e36786844eb2bcacb3bd6b099d78" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">The Growers By Ponte (Previously The Growers Shoalhaven)</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Restaurant</p>                 <p style="margin:0;"><b>Rating:</b> 4.0 (510.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.21</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 60.69269770408163%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"I can‚Äôt rave enough about Ponte ‚Äî this place is an absolute gem! The fresh, local menu is a true celebration of the region‚Äôs produce, and every dish was bursting with flavour. Honestly, it‚Äôs the best food I‚Äôve had anywhere, even outshining some top Sydney restaurants. The staff are wonderfully friendly and professional, making the whole experience even more memorable. And the venue itself is simply stunning ‚Äî it‚Äôs like stepping into a beautiful wedding venue. Do yourself a favour and book a table ‚Äî you won‚Äôt be disappointed!"</div>             </div>             </div>`)[0];
